in vec2 vUv;
out vec4 fragColor;
uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;

// --- UTILS & NOISE ---
float hash(vec2 p) {
    return fract(sin(dot(p, vec2(127.1, 311.7))) * 43758.5453123);
}

float noise(vec2 p) {
    vec2 i = floor(p);
    vec2 f = fract(p);
    vec2 u = f * f * (3.0 - 2.0 * f);
    return mix(mix(hash(i + vec2(0.0, 0.0)), hash(i + vec2(1.0, 0.0)), u.x),
               mix(hash(i + vec2(0.0, 1.0)), hash(i + vec2(1.0, 1.0)), u.x), u.y);
}

float fbm(vec2 p) {
    float v = 0.0;
    float a = 0.5;
    mat2 rot = mat2(1.6, 1.2, -1.2, 1.6);
    for (int i = 0; i < 7; i++) {
        v += a * noise(p);
        p = rot * p * 2.0;
        a *= 0.5;
    }
    return v;
}

// Terrain Height Function
float map(vec3 p) {
    float h = fbm(p.xz * 0.4) * 1.8;
    // Add craters
    vec2 craterP = p.xz * 0.2;
    float craters = pow(abs(sin(craterP.x) * cos(craterP.y)), 4.0) * 0.5;
    return p.y - (h - craters);
}

// Normal calculation
vec3 getNormal(vec3 p) {
    float e = 0.01;
    return normalize(vec3(
        map(vec3(p.x + e, p.y, p.z)) - map(vec3(p.x - e, p.y, p.z)),
        2.0 * e,
        map(vec3(p.x, p.y, p.z + e)) - map(vec3(p.x, p.y, p.z - e))
    ));
}

// Raymarching
float intersect(vec3 ro, vec3 rd) {
    float t = 0.1;
    for (int i = 0; i < 128; i++) {
        float h = map(ro + rd * t);
        if (h < 0.001 || t > 40.0) break;
        t += h * 0.5;
    }
    return t;
}

// Simple atmospheric scattering / fog
vec3 getAtmosphere(vec3 rd, vec3 sunDir) {
    float sun = max(dot(rd, sunDir), 0.0);
    vec3 sky = mix(vec3(0.4, 0.1, 0.05), vec3(0.7, 0.3, 0.1), pow(1.0 - max(rd.y, 0.0), 4.0));
    sky += vec3(1.0, 0.6, 0.3) * pow(sun, 32.0);
    sky += vec3(1.0, 0.4, 0.2) * pow(sun, 2.0) * 0.5;
    return sky;
}

void main() {
    vec2 uv = (gl_FragCoord.xy * 2.0 - iResolution.xy) / iResolution.y;

    // Mouse Interaction
    float mouseX = iMouse.z > 0.0 ? (iMouse.x / iResolution.x - 0.5) * 4.0 : 0.0;

    // Camera movement: Flying forward
    float speed = 2.5;
    vec3 ro = vec3(mouseX, 1.8, iTime * speed);
    vec3 lookAt = vec3(mouseX * 1.2, 1.2, iTime * speed + 5.0);

    // Simple camera matrix
    vec3 forward = normalize(lookAt - ro);
    vec3 right = normalize(cross(vec3(0.0, 1.0, 0.0), forward));
    vec3 up = cross(forward, right);
    vec3 rd = normalize(uv.x * right + uv.y * up + 1.5 * forward);

    // Lighting setup
    vec3 sunDir = normalize(vec3(0.8, 0.4, 1.0));
    vec3 marsDust = vec3(0.65, 0.32, 0.15);
    vec3 marsDark = vec3(0.25, 0.12, 0.05);

    float t = intersect(ro, rd);
    vec3 col;

    if (t < 40.0) {
        vec3 p = ro + rd * t;
        vec3 nor = getNormal(p);

        // Coloring based on height and normal
        float slope = 1.0 - nor.y;
        float heightNoise = fbm(p.xz * 2.0);
        vec3 baseCol = mix(marsDust, marsDark, slope + heightNoise * 0.3);

        // Diffuse lighting
        float diff = max(dot(nor, sunDir), 0.0);
        float amb = 0.15;

        // Specular (dry dusty look)
        float spec = pow(max(dot(reflect(rd, nor), sunDir), 0.0), 8.0) * 0.1;

        col = baseCol * (diff + amb) + spec;

        // Shadow (simplified)
        float sha = 1.0;
        float st = 0.05;
        for(int i=0; i<15; i++) {
            float h = map(p + sunDir * st);
            if(h < 0.001) { sha = 0.0; break; }
            st += h;
            if(st > 2.0) break;
        }
        col *= mix(0.4, 1.0, sha);

        // Distance fog / haze
        float fog = exp(-0.08 * t);
        col = mix(getAtmosphere(rd, sunDir), col, fog);
    } else {
        col = getAtmosphere(rd, sunDir);
    }

    // Post-processing: Contrast and Warmth
    col = pow(col, vec3(0.9)); // Gamma correction approx
    col = mix(col, vec3(dot(col, vec3(0.3, 0.59, 0.11))), -0.2); // Boost saturation

    // Vignette
    float vig = 1.0 - dot(uv, uv) * 0.15;
    col *= vig;

    fragColor = vec4(col, 1.0);
}
